package net.jeeshop.services.front.unionpay.impl;import net.jeeshop.core.ServersManager;import net.jeeshop.services.front.unionpay.UnionPayService;import net.jeeshop.services.front.unionpay.bean.UnionPay;import net.jeeshop.services.front.unionpay.dao.UnionPayDao;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;@Servicepublic class UnionPayServiceImpl extends ServersManager<UnionPay, UnionPayDao> implementsUnionPayService {		@Autowired	private UnionPayDao unionPayDao;		@Autowired	@Override	public void setDao(UnionPayDao dao) {		this.dao = dao;	}	@Override	public UnionPay selectByOrderId(String id) {		return unionPayDao.selectByOrderId(id);	}}